description:
Some stories don’t just entertain… they reveal the parts of us we hide.

Behind The Scenes is for anyone who has ever smiled through pain, carried invisible battles, or kept showing up even when it was hard.
It’s a story about truth, pressure, healing, and everything we don’t say out loud.

The official trailer is here.

In all cinemas nationwide from Dec 12th.
Get your tickets to the London Premiere of Behind The Scenes happening on December 4th, 8PM at Odeon Greenwich.

Get your tickets at www.odeon.co.uk

